import { combineReducers } from "redux";
import { userReducer } from "./user/user.reducer";
import { bookReducer } from "./book/book.reducer";
import { authReducer } from "./auth/auth.reducer";

export const rootReducer = combineReducers({
	user: userReducer,
	books: bookReducer,
	auth: authReducer,
});
